import React from 'react';
import Link from 'next/link'


const fakeData = [
  {
    id: 1,
    name: "ມັງພຸດ",
    description: "ຜົນລະໄມ້ສົດຈາກສ່ວນ",
    price: 105,
  },
  {
    id: 2,
    name: "ລຳໄຍ",
    description: "ຜົນລະໄມ້ສົດຈາກສ່ວນ",
    price: 125,
  },
  {
    id: 3,
    name: "ທຸເລືອນ",
    description: "ຜົນລະໄມ້ທີກູຍັງງົງຄົນກິນມັນໄດ້ແນວໃດ",
    price: 135,
  }
]
function products() {
  return (
    <div>
      {fakeData.map(prod => 
          <Link key={prod.id} href="">
            <a>
              <div>{prod.name}</div>
            </a>
          </Link>    
      )}
    </div>
  )
}

export default products
